import { specialTeas } from "./utility/menu/special-teas";
import { supahShakes } from "./utility/menu/supah-shakes";

export const MenuNav = () => {

    //move to util file later
    const menuCat = [
        'combos',
        'supah shakes',
        'special teas',
        'for you',
        'stays active',
        'goodies'
    ]

    return (
        <div className="menu-nav-categories">
            {menuCat.map((cat, i) =>
                <div
                    key={`category-${i}`}
                    className="category"
                >
                    {cat}
                </div>
            )}
        </div>
    );
};
